INSERT INTO `search` VALUES (1,'https://www.manhuagui.com/comic/20224/','博人传BORUTO(BORUTO-NARUTO NEXT GENERATIONS- 博人传-火影忍者新生代- )','简介：七代目火影漩涡鸣人治理的木叶村。那是经历了战争的历史之后人们讴歌和平的时代。但是鸣人与其儿子漩涡博人的关系却并不和平…[详情]',1557637834659,'地区：日本漫画','作者：岸本齐史,池本幹雄','类型：冒险,格斗',NULL),(2,'https://www.manhuagui.com/comic/21432/','火影忍者秘传‧阵之书','简介：火影忍者角色设定公式集「秘传・阵之书」，收录了纵横在忍界的２７０位角色以及２３２种术，是历代最大规模的设定集！[详情]',1557637834659,'地区：日本漫画','作者：岸本齐史','类型：格斗',NULL),(3,'https://www.manhuagui.com/comic/19187/','火影忍者外传~第七代火影与绯色的花月~','简介：震荡世界的忍界大战结束後，已经过了好一段时间，现在人们正享受着和平的世界。木叶忍者村也开始培育新一代的忍者。但是，拥有写轮眼的不明人物却开始蠢动，佐助和小樱的女儿．纱罗妲被盯上了!?[详情]',1557637834660,'地区：日本漫画','作者：岸本斉史','类型：冒险,格斗',NULL),(4,'https://www.manhuagui.com/comic/22356/','与你的未来(火影忍者同人)','简介：火影忍者“虐狗（划掉）”同人漫画，太治愈了！大家一定要看！[详情]',1557637834660,'地区：日本漫画','作者：里美','类型：爱情,治愈',NULL),(5,'https://www.manhuagui.com/comic/1305/','火影忍者秘传・者之书(火影忍者-者之书)','简介：《者之书》是日本漫画《火影忍者》的第4部官方资料设定集，由原作作者岸本齐史亲编。由集英社出版，于2008年9月在日本发售。其中收录的人物以及相关数据自漫画第二部开头的鸣人归乡开始，至“兄弟之战”、斑道出宇智波鼬的真相结束。[详情]',1557637834666,'地区：日本漫画','作者：岸本齐史','类型：热血,格斗',NULL),(6,'https://www.manhuagui.com/comic/1390/','火影忍者-临之书','简介：《临之书》是日本漫画《火影忍者》发布的第一部官方资料集，由原作作者岸本齐史亲编。由集英社出版。其中收录的数据及人物相关数据自鸣人毕业到中忍考试第三场（8月6日）结束。[详情]',1557637834668,'地区：日本漫画','作者：岸本齐史','类型：热血,格斗,武侠',NULL),(7,'https://www.manhuagui.com/comic/4952/','火影忍者-皆之书','简介：继火影忍者临之书、兵之书、斗之书、者之书后，岸本齐史推出最新的火影忍者资料集：《皆之书》为日本人气漫画《火影忍者》的官方角色资料片，由原作作者岸本齐史亲编。由集英社出版，将在09年12月份发售。[详情]',1557637834668,'地区：日本漫画','作者：岸本齐史','类型：热血,格斗',NULL),(8,'https://www.manhuagui.com/comic/1391/','火影忍者-斗之书','简介：《斗之书》为日本人气漫画《火影忍者》的官方角色资料片，由原作作者岸本齐史亲编，由集英社出版。详细介绍了《火影忍者》里的人物和术。[详情]',1557637834671,'地区：日本漫画','作者：岸本齐史','类型：热血,格斗,武侠',NULL),(9,'https://www.manhuagui.com/comic/1316/','火影忍者兵之书','简介：这是一个忍者的世界。在这里，忍者的职业是所有少年们的梦想！“女人,跟我走!”乌尔奇奥拉·西法——《死神》。主人公鸣人因为身上封印着邪恶的九尾狐，无父无母的他受尽了村人的冷落。无可奈何之下，鸣人拼命用各种恶作剧试图吸引大家的注意力。在依卡鲁老师的关心下，鸣人始终保持着乐观的精神。为了让更多的人认可自己，他下定决心要成为第五代火影！火影是世界上最强的五位忍者之一的封号，也是木和忍者村的首领。鸣人怀着过人的自信与勇气开始了训练，但一切要比他想象的要困难的多！ 鸣人的同伴，是有老师来确定同班同学—酷酷的帅哥佐助和聪明可爱的小孩小樱，虽然鸣人对小樱颇有好感，无奈小樱只关心佐助一人而已！ 不久[详情]',1557637834672,'地区：日本漫画','作者：岸本齐史','类型：热血,格斗',NULL),(10,'https://www.manhuagui.com/comic/14982/','宇智波佐助的写轮眼传(火影忍者衍生漫画)','简介：宇智波佐助…将化身进入爆笑的世界！！？[详情]',1557637834664,'地区：日本漫画','作者：平健史','类型：冒险,搞笑',NULL),(11,'https://www.tohomh123.com/yirenzhixia/','一人之下',NULL,1557643183657,NULL,NULL,NULL,NULL),(12,'https://www.tohomh123.com/qingrangxingzixiaojiexingfuba/','请让幸子小姐幸福吧',NULL,1557645459311,NULL,NULL,NULL,NULL),(13,'https://www.tohomh123.com/yaoguaimingchan/','妖怪名单',NULL,1557840689178,NULL,NULL,NULL,NULL),(14,'https://www.tohomh123.com/biaoren/','镖人',NULL,1557841129606,NULL,NULL,NULL,NULL),(15,'https://www.tohomh123.com/zuiainidenashinian/','最爱你的那十年',NULL,1558014935317,NULL,NULL,NULL,'https://mh1.xitangwenhua.com/pic/manhua/images/532953201938.jpg'),(16,'https://www.tohomh123.com/youzaishoushichongchongtianshengshengzai/','悠哉兽世：种种田，生生崽',NULL,1558014940416,NULL,NULL,NULL,'https://mh1.xitangwenhua.com/pic/manhua/images/2707352019425.jpg'),(17,'https://www.tohomh123.com/dierrensheng/','第二人生',NULL,1558014946502,NULL,NULL,NULL,'https://mh1.xitangwenhua.com/pic/manhua/images/915587201958.jpg'),(18,'https://www.tohomh123.com/zhendechouguniang/','朕的丑姑娘',NULL,1558014948309,NULL,NULL,NULL,'https://mh1.xitangwenhua.com/pic/manhua/images/5409372019228.jpg'),(19,'https://www.tohomh123.com/shidaiyaonie/','时代妖孽',NULL,1558014950142,NULL,NULL,NULL,'https://mh1.xitangwenhua.com/pic/manhua/images/2544832019227.jpg'),(20,'https://www.tohomh123.com/yuanzun/','元尊',NULL,1558014951953,NULL,NULL,NULL,'https://mh1.xitangwenhua.com/upload/yuanzun/cover.jpg'),(21,'https://www.tohomh123.com/shenbilianren/','神秘恋人',NULL,1558014953797,NULL,NULL,NULL,'https://mh1.xitangwenhua.com/pic/manhua/images/438196201938.jpg'),(22,'https://www.manhuagui.com/comic/24673/','魔卡少女樱原画集(百变小樱)','简介：魔卡少女樱（百变小樱）原画集[详情]',1558018659016,'地区：日本漫画','作者：CLAMP','类型：爱情,魔法','https://cf.hamreus.com/cpic/b/24673.jpg');
